<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Flocking Variable Font Showcase</title>
    <style>
        @font-face {
            font-family: 'FlockingVariable';
            src: url('FlockingVariableVF.ttf') format('truetype');
            font-weight: 100 1000;
        }

        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            background: #ffffff;
            color: #0a0a0a;
            font-family: system-ui, -apple-system, sans-serif;
            min-height: 100vh;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            padding: 40px 20px;
        }

        .showcase {
            width: 100%;
            max-width: 1400px;
        }

        .showcase-item {
            margin-bottom: 80px;
            margin-left: 80px;
        }

        .showcase-title {
            font-size: 18px;
            font-weight: 300;
            letter-spacing: 0.1em;
            text-transform: uppercase;
            margin-bottom: 20px;
            opacity: 0.5;
        }

        .animated-text {
            font-family: 'FlockingVariable', sans-serif;
            font-variation-settings: 'wght' 100, 'GRAV' 100;
            font-size: 160px;
            line-height: 1.2;
            display: inline-block;
        }

        /* Animation 1: Wave effect */
        @keyframes wave-animation {
            0% {font-variation-settings: 'wght' 100, 'GRAV' 100;}
            50% {font-variation-settings: 'wght' 1000, 'GRAV' 1000;}
            100% {font-variation-settings: 'wght' 100, 'GRAV' 100;}
        }

        .wave-char {
            animation-name: wave-animation;
            animation-duration: 9000ms;
            animation-iteration-count: infinite;
            animation-timing-function: ease-in-out;
        }

        .wave-char:nth-child(1) { animation-delay: 0ms; }
        .wave-char:nth-child(2) { animation-delay: 250ms; }
        .wave-char:nth-child(3) { animation-delay: 500ms; }
        .wave-char:nth-child(4) { animation-delay: 750ms; }
        .wave-char:nth-child(5) { animation-delay: 1000ms; }
        .wave-char:nth-child(6) { animation-delay: 1250ms; }
        .wave-char:nth-child(7) { animation-delay: 1500ms; }
        .wave-char:nth-child(8) { animation-delay: 1750ms; }
        .wave-char:nth-child(9) { animation-delay: 2000ms; }
        .wave-char:nth-child(10) { animation-delay: 2250ms; }

    

    

        /* Animation 2: Pulse all together */
        @keyframes pulse-animation {
            0%, 100% {font-variation-settings: 'wght' 100, 'GRAV' 100;}
            50% {font-variation-settings: 'wght' 1000, 'GRAV' 1000;}
        }

        .pulse-char {
            animation-name: pulse-animation;
            animation-duration: 6750ms;
            animation-iteration-count: infinite;
            animation-timing-function: ease-in-out;
        }

        /* Animation 3: Alternating */
        @keyframes alt-heavy {
            0%, 100% {font-variation-settings: 'wght' 1000, 'GRAV' 1000;}
            50% {font-variation-settings: 'wght' 100, 'GRAV' 100;}
        }

        @keyframes alt-light {
            0%, 100% {font-variation-settings: 'wght' 100, 'GRAV' 100;}
            50% {font-variation-settings: 'wght' 1000, 'GRAV' 1000;}
        }

        .alt-char:nth-child(odd) {
            animation-name: alt-heavy;
            animation-duration: 6750ms;
            animation-iteration-count: infinite;
            animation-timing-function: ease-in-out;
        }

        .alt-char:nth-child(even) {
            animation-name: alt-light;
            animation-duration: 6750ms;
            animation-iteration-count: infinite;
            animation-timing-function: ease-in-out;
        }

        /* Animation 4: Weight only */
        @keyframes weight-animation {
            0%, 100% {font-variation-settings: 'wght' 100, 'GRAV' 1000;}
            50% {font-variation-settings: 'wght' 1000, 'GRAV' 1000;}
        }

        .weight-char {
            animation-name: weight-animation;
            animation-duration: 3500ms;
            animation-iteration-count: infinite;
            animation-timing-function: ease-in-out;
        }

        .weight-char:nth-child(1) { animation-delay: 0ms; }
        .weight-char:nth-child(2) { animation-delay: 200ms; }
        .weight-char:nth-child(3) { animation-delay: 400ms; }
        .weight-char:nth-child(4) { animation-delay: 600ms; }
        .weight-char:nth-child(5) { animation-delay: 800ms; }
        .weight-char:nth-child(6) { animation-delay: 1000ms; }



        /* Animation 5: Gravity only */
        @keyframes gravity-animation {
            0%, 100% {font-variation-settings: 'wght' 550, 'GRAV' 100;}
            50% {font-variation-settings: 'wght' 550, 'GRAV' 1000;}
        }

        .gravity-char {
            animation-name: gravity-animation;
            animation-duration: 7000ms;
            animation-iteration-count: infinite;
            animation-timing-function: ease-in-out;
        }

        .gravity-char:nth-child(1) { animation-delay: 0ms; }
        .gravity-char:nth-child(2) { animation-delay: 500ms; }
        .gravity-char:nth-child(3) { animation-delay: 1000ms; }
        .gravity-char:nth-child(4) { animation-delay: 1500ms; }
        .gravity-char:nth-child(5) { animation-delay: 2000ms; }
        .gravity-char:nth-child(6) { animation-delay: 2500ms; }
        .gravity-char:nth-child(7) { animation-delay: 3000ms; }
        .gravity-char:nth-child(8) { animation-delay: 3500ms; }


/* gravity reversed */
 .gravity-reverse {
            animation-name: gravity-reverse-animation;
            animation-duration: 7000ms;
            animation-iteration-count: infinite;
            animation-timing-function: ease-in-out;
        }

        .gravity-reverse:nth-child(1) { animation-delay: 3500ms; }
        .gravity-reverse:nth-child(2) { animation-delay: 3000ms; }
        .gravity-reverse:nth-child(3) { animation-delay: 2500ms; }
        .gravity-reverse:nth-child(4) { animation-delay: 2000ms; }
        .gravity-reverse:nth-child(5) { animation-delay: 1500ms; }
        .gravity-reverse:nth-child(6) { animation-delay: 1000ms; }
        .gravity-reverse:nth-child(7) { animation-delay: 500ms; }
        .gravity-reverse:nth-child(8) { animation-delay: 0ms; }

          @keyframes gravity-reverse-animation {
             0%, 100% {font-variation-settings: 'wght' 550, 'GRAV' 100;}
            50% {font-variation-settings: 'wght' 550, 'GRAV' 1000;}
        }


 /* Animation: Particle Size effect */
        @keyframes particle-size-animation {
            0% {font-variation-settings: 'wght' 100, 'GRAV' 1000, 'SIZE' 0;}
            50% {font-variation-settings: 'wght' 100, 'GRAV' 1000, 'SIZE' 100;}
            100% {font-variation-settings: 'wght' 100, 'GRAV' 1000, 'SIZE' 0;}
        }

        .ptsz-char {
            animation-name: particle-size-animation;
            animation-duration: 5500ms;
            animation-iteration-count: infinite;
            animation-timing-function: ease-in-out;
        }

        .ptsz-char:nth-child(1) { animation-delay: 0ms; }
        .ptsz-char:nth-child(2) { animation-delay: 250ms; }
        .ptsz-char:nth-child(3) { animation-delay: 500ms; }
        .ptsz-char:nth-child(4) { animation-delay: 750ms; }
        .ptsz-char:nth-child(5) { animation-delay: 1000ms; }
        .ptsz-char:nth-child(6) { animation-delay: 1250ms; }
        .ptsz-char:nth-child(7) { animation-delay: 1500ms; }
        .ptsz-char:nth-child(8) { animation-delay: 1750ms; }
        .ptsz-char:nth-child(9) { animation-delay: 2000ms; }
        .ptsz-char:nth-child(10) { animation-delay: 2250ms; }
         .ptsz-char:nth-child(11) { animation-delay: 2500ms; }
          .ptsz-char:nth-child(12) { animation-delay: 2750ms; }
    



        /* Responsive */
        @media (max-width: 768px) {
            .animated-text {
                font-size: 60px;
            }
            
            .showcase-title {
                font-size: 14px;
            }
        }

        @media (max-width: 480px) {
            .animated-text {
                font-size: 40px;
            }
        }
        svg path{
            fill:black;
        }
       
    </style>
</head>
